						$i = count($all_caption);
					}
				}
				
			}
			if($k == "color")
			{
				$array[$k] = $temp[$group];
				//$v = 'new value';
				//echo "$array[$k]";
			}
			//echo "$k => $v <br>";
        } 
    } 

    return $array; 
} 
