function keyword_cnt( &$similar_arr , $i_len , $j_len ){


		$temp_max = 0;
		$min_tag=false;
		$temp_i=0;
		$temp_j=0;

		
		for( $i = 0 ; $i < $i_len ; $i++){
			for( $j = 0 ; $j < $j_len ; $j++){

				if( $similar_arr[$i][$j]  > $temp_max    ){
					
					$temp_max = $similar_arr[$i][$j];
					$min_tag = true;
					$temp_i=$i;
					$temp_j=$j;
				}
			}
		}
		


		if( $min_tag ){
			for( $j = 0 ; $j < $j_len ; $j++)
				$similar_arr[ $temp_i ][ $j ]=0;

			for( $i=0 ; $i < $i_len ; $i++ )
				$similar_arr[ $i ][ $temp_j ]=0;

			
		}


		
		return $temp_max;

}


